import React from 'react';
import '../App.css';

function About({ match }) {
  const value = match.params.name;
  return (
    <form className="box">
      <h1>{`This page is for ${value.substr(1)}`}</h1>

      <button type="submit">
        Share
            </button>
    </form>
  )
}
export default About;
